import { Box, Card, CardContent, CardMedia, Typography } from "@mui/material";
import { useEffect, useState } from "react";
import axios from 'axios';

export const Product = () => {
            const [data, setData]=useState([])
            const [loading, setloading]=useState(true)

        useEffect(() => {
            axios.get(`https://dummyjson.com/products`)

            .then((res)=>{
                
                if(res.data){
                    setloading(false)
                    setData(res.data.products)
                }    
            })

            .catch((err)=>{
                console.log("Err",err)
            })

        },[]);
        
        console.log("data",data)
    return (
        <>
            <Box sx={{ gap: "20px", display: "grid", width: "100vw", justifyContent: "space-around", marginTop: "100px", gridTemplateColumns: "auto auto auto" }}>
            {loading?<div> loading </div>: <span> {data.length>0&&data.map((carditem, index) => {
                    <Card key={index} sx={{ maxWidth: 345 }}>
                    <CardMedia
                            component="img"
                            height="140"
                            image={carditem.images[0]}
                        />
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="div">
                                {carditem.title}
                            </Typography>
                            <Typography variant="body2" color="text.secondary">
                                {carditem.price}
                            </Typography>
                        </CardContent>
                    </Card>

                })}</span>}
            
                
            </Box>
        </>
    )
};
